		<!--page script for canvas-->
		
<script>
// pure javascript + atrament 
		var canvas = document.getElementById('sketcher');
		var atrament = atrament(canvas, canvas.offsetWidth, canvas.offsetHeight);

		var clearButton = document.getElementById('clear');
		canvas.addEventListener('dirty', function(e) {
			clearButton.style.display = atrament.dirty ? 'inline-block' : 'none';
		});
			
// jquery		
	var $drawing = $('#drawing'),
		$drawingSelect = $('#select-drawing'),
		$colorSelect = $('#select-color');

	var color = $colorSelect[0].value;
	console.log($colorSelect);

	$drawingSelect.change(function(event) {  
	  $drawing.load(event.target.value);
	});

	$colorSelect.change(function(event) {
	  color = event.target.value;
	});

	$drawing.click(function(event) {
	  event.target.style.fill = color;
	});

		</script>
